INSERT INTO `news` (`id`, `title`, `content`, `created_at`, `user_id`, `category`, `stars`) VALUES
(16, 'Zima se blíží, separatisté v Donbasu začali těžit uhlí', 'Východní Ukrajinou už přes půl roku zmítají boje mezi armádou a proruskými separatisty.\n\nTrpí tím nejen miliony Ukrajinců, ale i těžký průmysl, který je v Donbasu situován.\n\nNedostatkovým zbožím se s nadcházející zimou stalo především uhlí. Povstalci proto po několika měsících obnovili těžbu v dolu číslo 22 Kommunar ve vesnici Nižní Krynka, ležící východně od milionového Doněcku.\n\nTen byl donedávna pod kontrolou ukrajinských bezpečnostních sil a dobrovolnického praporu Aidar.', '2015-04-29 21:46:06', 11, 'politika', 3),
(17, 'Tuhá zima se blíží', 'Ve čtvrtek 21. října při běžném výkonu služby si policisté Odboru specializovaných činností Frýdek-Místek v katastru obce Chlebovice v areálu bývalé vojenské střelnice všimli zaparkovaného osobního vozidla s přívěsným vozíkem. Vozík byl do dvou třetin zaplněn čerstvě pořezaným dřevem, vedle byly připravena k naložení další dva kusy dřeva a opodál stál muž. Policisté přijeli k autu v době, kdy z lesíka přicházeli další dva muži, z nichž jeden nesl motorovou pilu. Na dotaz, co zde pohledávají, odpověděli, že zde sbírají suché popadané stromy a větve a že mají ústní povolení stavbyvedoucího. Jeden z mužů předal číslo na mobil stavbyvedoucího policistům k ověření informace. Výsledkem telefonátu bylo sdělení, že dotyční muži si ze stavby silničního obchvatu mohli odebrat suché dřevo a zbytky po těžbě, ale na jaře. V současné době pohyb po staveništi za účelem odklizení dřeva nebyl nikomu povolen. Jelikož vzniklo podezření, že zde dochází k nepovolené těžbě dřeva, byli přivoláni policisté Obvodního oddělení PČR Pálkovice, kteří si celou záležitost na místě převzali k dalšímu šetření.', '2015-04-29 21:48:04', 11, 'politika', 3),
(18, 'Zima se blíží!', 'Jestli jste milovníci zimních radovánek, tak si zajisté po loňském zklamání přejete, aby letos napadaly celé závěje sněhu, a vy jste mohli zase vytáhnout ze sklepů lyže a oddávat se potěšení z jízdy a kochat se výhledy do zasněžené krajiny. V hromady sněhu doufají pochopitelně i výrobci lyží, jak nám potvrdil generální ředitel výrobního podniku lyží Sporten Ján Hudák v září na tiskové konferenci v Novém Městě na Moravě. Po představení novinek pro rok 2014–15 nám otevřeli dveře i do výrobních hal podniku a seznámili nás s technologiemi výroby lyží.\n\nHistorie výroby lyží ve firmě Sporten v Novém Městě na Moravě sahá až do roku 1896, kdy se zde vyráběly lyže v malých řemeslných dílnách, a každý pár byl nezaměnitelným originálem. Za více než sto let se toho hodně změnilo, nejen v použitých materiálech, ale zejména v technologii výroby. Stále se vyrábějí lyže dřevěné, ale také lyže polyuretanové. Rozdíl mezi nimi je zcela zásadně v ceně a výrobní technologii.\nMánička', '2015-04-29 21:49:42', 11, 'sport', 3),
(19, 'Zima se blíží...', 'O kočkách je známo, že nemají rády zimu. Jak jim tedy chladné podzimní a zimní měsíce alespoň trochu zpříjemnit?\n \nPro volně žijící kočky je zima nejtěžším obdobím v roce. Nízké teploty, sníh, mráz, studený vítr, menší a složitější možnosti při hledání potravy - to vše představuje hrozbu pro jejich přežití.\n\n \n\nV chladnějším období mají kočky zvýšenou potřebu spánku a vyhledávají teplejší místečka. Venkovním kočkám proto zpřístupníme ke spaní garáž, kůlnu, sklep nebo půdu. Připravíme sem jednu či více krabic vystlaných starým oblečením nebo senem a kočka si sama vybere místo, které jí bude vyhovovat. Pokud nemáme podobné prostory, můžeme vyrobit kočičí zateplenou boudičku, umístit ji na místo chráněné před větrem a zajistit do ní větší množství sena či slámy.\n\n \n\nV zimě je nutné kočkám dávat i více potravy, příp. výživnější stravu – jednak proto, že kvůli zahřátí spotřebují více energie, jednak kvůli tomu, že v zimě nemohou lovit myši. Pravidelně kontrolujeme i misku s vodou, zda nezamrzla. Kočky jsou pak nuceny jíst sníh, z čehož mívají zdravotní problémy. A Vy pak možná také - z částky zaplacené u veterináře.\n\n \n\nDivoce žijící kočky se o sebe obvykle dokážou postarat samy. Jsou od přírody aktivní lovci a když mohou, hledají příležitosti k lovu. Kočky patří mezi masožravce, a proto potřebují k životu vyváženou stravu, bohatou na živočišné bílkoviny. Z tohoto důvodu loví hlodavce a ptáky. Nicméně s nadcházejícím podzimem hledají i tato zvířata úkryt, ve kterém přečkají zimu. Kočky je pak nemohou lovit a musí hledat potravu jinde. Když nemají jinou možnost, hledají, kde se dá. Můžeme se pak s nimi setkat třeba i u popelnic, kde se prohrabávají odpadky a hledají něco k snědku.\n\n \n\nPři hledání jídla a teplého přístřeší přicházejí kočky také do našich domovů, kde jsou často nevítanými hosty. Snaží se dostat do sklepních prostor nebo garáží a bohužel se někdy stává, že zavřené v nich zahynou. Zimu přečkávají kočky ve skupinách, kdy takovou skupinu může tvořit i několik desítek jedinců. Když je jim zima, lehají si blízko sebe a navzájem se zahřívají. Když teplota klesne pod 10 stupňů zavinou se do klubíčka a ocasem si přikrývají nos. Nos a horní část tlamičky jsou totiž velice citlivé na změnu teploty. Jakmile v zimě na chvíli vysvitne sluníčko, lezou na zídky a střechy budov, aby se alespoň trošku ohřály ve svitu slunečních paprsků. V zimě je také můžeme vidět na parkovištích, jak leží na kapotě zrovna zaparkovaného auta v místech, kde je motor, který ještě nevychladl.\n\n \n\nKočky jsou tedy v zimě ohroženy nejen nedostatečným zdrojem potravy, ale i možností prochladnutí a umrznutí. Už teplota okolo mínus 5-10 stupňů Celsia může být pro ně životu nebezpečná. Ve větší zimě už bez naší pomoci nemusí přežít...', '2015-04-29 21:50:42', 10, 'politika', 3),
(20, 'Lannister vždy splácí své dluhy', 'Potom, co Tyrion s Bronnem opustili Orlí Hnízdo, vyprávěl Tyrion Bronnovi celý příběh ohledně Tyshy. Bronn mu tenkrát řekl, že by Tywina na místě zabil za to, co mu udělal. Tyrion prohlásil, že ten čas možná někdy přijde, protože Lannister vždy splácí své dluhy.\n\nKdyž Jaime vysvobodil Tyriona ze žaláře, ještě předtím, než ho opustil, se mu přiznal k tomu, že jeho dávná historka ohledně Tyshy nebyla pravdivá, a že Tysha ve skutečnosti byla opravdu jen prostá dívka utíkající před barbary. Tyrion se velmi rozzlobil a šel přímo do komnaty svého otce Tywina. Požadoval po něm, aby mu řekl co se potom s Tyshou stalo, když bylo po všem. Tywin mu na to odpověděl, že šla tam, kam chodí všechny děvky. Tyrion poté Tywina zastřelil kuší a uprchl.', '2015-04-29 21:52:50', 11, 'politika', 3),
(21, 'Koláče bývají nejedlé', 'Král Joffrey si přál darovat na své svatbě hlavy Sansina bratra a matky na podnose, to přání se mu ovšem nesplnilo, když poprvé okusil svatební koláč, jeden ze sedmdesáti sedmi chodů, navzdory tomu že město hladovělo, se Joffrey začal dusit a zemřel své matce v náručí.\nZa jeho smrt byl obviněn Tyrion, ale spíš byla na vině Sansina síťka na vlasy, z které se uvolnil jeden krystalek jedu.', '2015-04-29 21:57:48', 11, 'zábava', 3),
(22, 'Moje postava si zaslouží zemřít', 'Britský herec Iwan Rheon v rozhovoru pro pořad This Morning přiznal, že jeho postava Ramsaye Boltona v seriálu Hra o trůny si zaslouží zemřít. A ne jen tak ledajakou smrtí. „Líbila by se mi smrt spojená s draky,“ popsal svou představu.', '2016-05-29 09:23:51', 10, 'zábava', 3),
(24, 'Jágr na Světovém poháru hrát nebude', '<p>Hokejov&aacute; reprezentace se na podzim v Torontu představ&iacute; na Světov&eacute;m poh&aacute;ru bez Jarom&iacute;ra J&aacute;gra. &Scaron;&eacute;fov&eacute; česk&eacute;ho v&yacute;běru o start hvězdn&eacute;ho &uacute;točn&iacute;ka Floridy hodně st&aacute;li, gener&aacute;ln&iacute; manažer Martin Ručinsk&yacute; v&scaron;ak nakonec usly&scaron;el zam&iacute;tav&eacute; J&aacute;grovo stanovisko.</p>', '2016-05-29 19:19:42', 9, 'politika', 3),
(25, 'Jak si snowboardistka bez zábran natloukla', '<p>Snowboardistka &Scaron;&aacute;rka Pančochov&aacute; se proslavila ve sportovn&iacute;m světě, když na olympijsk&yacute;ch hr&aacute;ch v Soči 2014 &uacute;točila v discipl&iacute;ně slopestyle na medaili. Ale měla těžk&yacute; p&aacute;d na hlavu. Na mistrovstv&iacute; světa ve &Scaron;panělsku jej&iacute; ambice zničila dal&scaron;&iacute; nehoda. Přesto zase bude dělat bl&aacute;zniv&eacute; triky při big airu, nov&eacute; olympijsk&eacute; discipl&iacute;ně.</p>\n<p><strong>Snowboardistka &Scaron;&aacute;rka Pančochov&aacute; se proslavila ve sportovn&iacute;m světě, když na olympijsk&yacute;ch hr&aacute;ch v Soči 2014 &uacute;točila v discipl&iacute;ně slopestyle na medaili. Ale měla těžk&yacute; p&aacute;d na hlavu. Na mistrovstv&iacute; světa ve &Scaron;panělsku jej&iacute; ambice zničila dal&scaron;&iacute; nehoda. Přesto zase bude dělat bl&aacute;zniv&eacute; triky při big airu, nov&eacute; olympijsk&eacute; discipl&iacute;ně.</strong></p>', '2017-03-13 16:28:22', 10, 'sport', 2),
(26, 'Toto je první Hurvínkova zpráva', 'Hurá, jsem redaktor!', '2017-04-11 18:05:25', 11, 'zábava', 3);

